import axios from "axios";
import { useEffect } from "react";

const App = () => {
  document.title = "test app";
  useEffect(() => {
    axios.get("https://restcountries.com/v3.1/all")
    .then((response) => {
      const persons = response.data;
      console.log(persons);
    });
  }, []);

  return <Course />;
};

export default App;
